tables.table_schema:
CREATE TABLE session_feedback (
    feedback_id INT PRIMARY KEY,
    session_id INT,
    feedback_text TEXT,
    rating INT
);

CREATE TABLE therapist_records (
    therapist_id UUID PRIMARY KEY,
    therapist_name VARCHAR(100) NOT NULL,
    therapist_license_number VARCHAR(50) NOT NULL
);

CREATE TABLE patient_records (
    patient_id UUID PRIMARY KEY,
    patient_name VARCHAR(100) NOT NULL,
    patient_date_of_birth DATE NOT NULL,
    patient_gender VARCHAR(10) NOT NULL
);

CREATE TABLE therapist_performance (
    therapist_id INT PRIMARY KEY,
    sessions_attended INT,
    average_rating FLOAT,
    notes TEXT
);
